import React from 'react';
import { Diff, parseDiff } from 'react-diff-view';
import 'react-diff-view/style/index.css';

const CodeDifferentiator = ({ old, news }) => {

  const hunks = parseDiff(old,news); // Handle empty values
  if(old)
    {
      return <p>{old}</p>
    }
  const message = hunks.length ? '' : 'No differences found'; // Display message for no changes

  return <Diff hunks={hunks} noDiffMessage={message} />; // Pass message prop to Diff
};

const App = () => {
  const oldcode = `
    function MyComponent() {
      return <div>Hello, new world!</div>;
    }
  `;

  const newcode = `
    function MyComponent() {
      return <div>Hello, old world!</div>;
    }
  `;

  return (
    <div>
      <h1>Code Difference Viewer</h1>
      <CodeDifferentiator old={oldcode} news={newcode} />
    </div>
  );
};

export default App;
